import React, { Component } from 'react';
import Logo from "../imgs/logo.png";

class MainBody extends Component {
    state = {  }
    render() { 
        return ( 
            <div className="container">
               <img 
               src={Logo} 
               alt="" 
               className="logo" />
                   <h1>We Rise Together By Helping Eachother</h1>
            </div>
         );
    }
}

export default MainBody ;
